SELECT * FROM messbox.messages;

CREATE TABLE messbox.messages(
   ID           INTEGER  NOT NULL PRIMARY KEY 
  ,RECIEVER_ID  INTEGER  NOT NULL
  ,PICTURE      VARCHAR(46) NOT NULL
  ,NAME         VARCHAR(17) NOT NULL
  ,COMPANY      VARCHAR(9) NOT NULL
  ,EMAIL        VARCHAR(28) NOT NULL
  ,PHONE        VARCHAR(17) NOT NULL
  ,ADDRESS      VARCHAR(62) NOT NULL
  ,MESSAGE      VARCHAR(493) NOT NULL
  ,MESSAGE_TIME VARCHAR(19) NOT NULL
);






